import React, { useState } from "react";
import { Table, Button, Form, Modal } from "react-bootstrap";

const Products = () => {
    const [users, setUsers] = useState([]);
    const [showModal, setShowModal] = useState(false);
    const [editingUser, setEditingUser] = useState(null);
    const [formData, setFormData] = useState({ name: "", email: "" });

    const handleInputChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        if (editingUser !== null) {
            setUsers(users.map((user, index) => (index === editingUser ? formData : user)));
        } else {
            setUsers([...users, formData]);
        }
        setShowModal(false);
        setEditingUser(null);
        setFormData({ name: "", email: "" });
    };

    const handleEdit = (index) => {
        setEditingUser(index);
        setFormData(users[index]);
        setShowModal(true);
    };

    const handleDelete = (index) => {
        setUsers(users.filter((_, i) => i !== index));
    };

    return (
        <div className="container mt-5">
            <h2 className="text-center mb-4">CRUD con React y Bootstrap</h2>
            <Button variant="primary" onClick={() => setShowModal(true)}>Agregar Usuario</Button>
            <Table striped bordered hover className="mt-3">
                <thead>
                    <tr>
                        <th>Nombre</th>
                        <th>Email</th>
                        <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {users.map((user, index) => (
                        <tr key={index}>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                            <td>
                                <Button variant="warning" onClick={() => handleEdit(index)} className="me-2">Editar</Button>
                                <Button variant="danger" onClick={() => handleDelete(index)}>Eliminar</Button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </Table>

            <Modal show={showModal} onHide={() => setShowModal(false)}>
                <Modal.Header closeButton>
                    <Modal.Title>{editingUser !== null ? "Editar Usuario" : "Agregar Usuario"}</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <Form onSubmit={handleSubmit}>
                        <Form.Group className="mb-3">
                            <Form.Label>Nombre</Form.Label>
                            <Form.Control
                                type="text"
                                name="name"
                                value={formData.name}
                                onChange={handleInputChange}
                                required
                            />
                        </Form.Group>
                        <Form.Group className="mb-3">
                            <Form.Label>Email</Form.Label>
                            <Form.Control
                                type="email"
                                name="email"
                                value={formData.email}
                                onChange={handleInputChange}
                                required
                            />
                        </Form.Group>
                        <Button variant="primary" type="submit">{editingUser !== null ? "Actualizar" : "Agregar"}</Button>
                    </Form>
                </Modal.Body>
            </Modal>
        </div>
    );
};

export default Products;
